How to display field contents nicely after retrieving all documents from collection<p>I have a <code>users</code> collection in MongoDB Cloud, that I'd like to display in my chat app in browser. I've retrieved the names and their privileges with this function below, but the data gets displayed in json format.</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>outer.get("/chat", function (req, res, next) {
  User.find({}, { fullname: "!null", privilege: "!null" }).exec(function (
    error,
    user,
  ) {
    if (error) {
      return next(error);
    } else {
      if (user === null) {
        const err = new Error("Not authorized! Go back!");
        err.status = 400;
        return next(err);
      } else {
        res.render("chat.pug", { user });
        console.log(user);
      }
    }
  });
});</code></pre>
</div>
</div>
</p>
<p>I just want the name of the user, his privilege below, without the _id field and also formated nicely.</p>
<p>I'm also using pug to render the template, and this code <code>#{user}</code> displays the documentd retreived, I also used <code>User.findById(req.session.userId)</code> to just get his name with <code>#{user.fullname}</code></p>
<p><a href="https://i.stack.imgur.com/7Xz3S.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/7Xz3S.png" alt="enter image description here" /></a></p>
<p>I would appreciate any help as this is my diploma thesis!</p>
<p><strong>Edit:</strong></p>
<p>This is the query I'm using to retrieve all documents' fullname and privilege, but I'm not sure it's the best practice.</p>
<p><a href="https://i.stack.imgur.com/3DrfX.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/3DrfX.png" alt="enter image description here" /></a>
The loop that Dori Lahav Waisberg suggested seem to format my data, but I cannot access the fields with the dot operator.</p>
<p><a href="https://i.stack.imgur.com/WGL3q.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/WGL3q.png" alt="enter image description here" /></a></p>

