<pre><code>const postSchema = new Schema({
    user: {
        type: Schema.Types.ObjectId,
        ref: 'User',
        required: true
    },

    caption: {
        type: String
    },

    action: {
        type: [{
            actionName: {
                type: String,
                required: true
            },
            user: {
                type: Schema.Types.ObjectId,
                ref: 'User'
            }
        }],
        default: []
    },

    shares: [{
        type: Schema.Types.ObjectId,
        ref: 'User'
    }];
});
</code></pre>
<p>All I want is to have a mongodb query with or without using <code>.aggregate()</code> to get the <code>user</code> &amp; <code>caption</code> field as it is but instead of <code>action</code> and <code>shares</code> I want their counts for a particular document.</p>
<p><strong>Sample Document</strong></p>
<pre><code>{
    _id: &quot;fgsergehegoieofgesfglesfg&quot;,

    user: &quot;dfjksjdnfkjsdfkjsdklfjglkbj&quot;,

    caption: &quot;This is the post caption&quot;,

    action: [
        {
            actionName: 'e1', user: &quot;sdfasdsdfasdfdsdfac951e5c&quot;
        },
        {
            actionName: 'e1', user: &quot;asdfmadfadfee103c9c951e5d&quot;
        },
        {
            actionName: 'e2', user: &quot;op34937cdbae0cd4160bbec&quot;
        },
        {
            actionName: 'e2', user: &quot;2543ebbasdfd1750690b5b01c&quot;
        },
        {
            actionName: 'e3', user: &quot;asdfcfebdb5dd1750690b5b01d&quot;
